//? Elementos del html
const tabla = document.getElementById("data");
const abrirModal = document.getElementById('btnAgregar');
const modal = document.getElementById('modal');
const formulario = document.getElementById('formulario');

//? Variables o constantes que uso
let data, url = 'http://127.0.0.1:5500/web/modulos/Bebidas/';

abrirModal.addEventListener('click', () => {
  modal.style.display = 'block';
});

document.getElementById('cerrarModal').addEventListener('click',(e)=>{
    e.preventDefault();
    modal.style.display = 'none';
});

const obtenerDatos= async () => {
    const data = await fetch(url+'Bebidas.json');
    let newData = await data.json();
    let html="";
    newData.forEach(element => {
        html+=`<tr class="cuerpo">
                  <td>${element.nombre}</td>
                  <td>${element.descripcion}</td>
                  <td>${element.categoria}</td>
                  <td>
                    <button onclick="ver(${element.id})" class="boton-icono"><img src="data:image/png;base64," /></button>
                    <button onclick="editar(${element.id})" class="boton-icono"><img src="data:image/png;base64," /></button>
                    <button onclick="eliminar(${element.id})" class="boton-icono"><img src="data:image/png;base64," /></button>
                  </td>
                </tr>`;
    });
    tabla.innerHTML =html;
}

const convertImageToBase64 = () => {
  const input = document.getElementById('input');
  const imagen = input.files[0];

  const reader = new FileReader();
  reader.onload = () => {
    const base64 = reader.result;
    const img = document.getElementById('img');
    img.src = base64;
  };
  /*let base64img = reader.readAsDataURL(imagen);
  console.log(base64img);*/
};

obtenerDatos();